import React ,{useEffect, useState} from "react";


const Cont =()=>
{

    const[num,setNum]=useState(0);
    

    useEffect(()=>
    {
                    alert("I am clicked");
            

    },[num]);

    return(
        <>
        <button
         onClick={()=>{
            setNum(num+1);
            }}
            >
            click me {num}
            </button>
            

           

</>
    );
};

export default Cont;
